  const navigate = useNavigate();

  const handleSignup = (email, password) => {
    console.log("Signing up with:", email, password,username,address,);
    navigate("/chat");
  };

  return (
    <AuthForm
      title="انشاء حساب "
      buttonText=" انشاء"
      onSubmit={handleSignup}
      linkText="لدي حساب ؟"
      linkTo="/login"
      linkAction="Log In"
    />
  );
};

export default Signup;
